import React, { Fragment, useState, useCallback } from "react";
import PropTypes from "prop-types";

const type_opcen = props => {
  const [opcenType, setopcenType] = useState("");
  return (
    <Fragment>
      <div
        style={{
          padding: "20px",
          background: "#fff",
          borderRadius: "10px",
        }}
      >
        <div
          style={{
            display: "block",
            borderRadius: "10px",

            padding: "20px",
          }}
        >
          <h1 className='large text-primary'>Create your Operation Center</h1>
          <p className='lead'>
            <i className='fas fa-user'></i> Choose your type of organization.
          </p>
        </div>

        <div
          style={{
            display: "flex",
            flexDirection: "row",
            width: "100%",
            justifyContent: "space-around",
          }}
        >
          <div className='bigIcon'>
            <div style={{ marginTop: "35%" }}>
              <i className='fa fa-thumbs-o-up' aria-hidden='true'></i>
              <p> Government (LGU)</p>
            </div>
          </div>
          <div className='bigIcon'>
            <div style={{ marginTop: "35%" }}>
              <i className='fa fa-thumbs-o-up' aria-hidden='true'></i>
              <p> Volunteer</p>
            </div>
          </div>
          <div className='bigIcon'>
            <div style={{ marginTop: "35%" }}>
              <i className='fa fa-thumbs-o-up' aria-hidden='true'></i>
              <i aria-hidden='true'></i>
              <p> Private</p>
            </div>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

type_opcen.propTypes = {};

export default type_opcen;
